import React from 'react';
function Navbar1() {
  return (
    <>
 <nav>
            <h3 className="brand">SHow Chart</h3>
<ul><li><a href="#">Home</a></li></ul>
          </nav>
     
    </>
  );
}

export default Navbar1;
